import React, { useContext } from 'react';
import styled from 'styled-components';
import { Redirect } from 'react-router-dom';

const Content = styled.div`
  padding: 2rem 5vw;
  grid-area: content;
`;

function HomeView() {

  return (
    <div>
      <Redirect to="/image-upload/" />
      <Content>
          <h2>Home</h2>
      </Content>
    </div>
  );
}

export default HomeView;
